      ];

      const expectations = [
        'توفير بيئة اجتماعية داعمة',
        'تنظيم فعاليات منتظمة',
        'المساعدة في التأقلم مع الحياة في بريطانيا',
        'ربط الطلاب ببعضهم البعض',
        'تقديم الدعم الإداري والاستشاري',
        'الحفاظ على الهوية الثقافية السعودية',
        'توفير معلومات عن الخدمات المحلية',
        'تمثيل الطلاب أمام الجهات الرسمية'
      ];

      const communicationMethods = [
        'مجموعات واتساب',
        'حسابات وسائل التواصل الاجتماعي',
        'البريد الإلكتروني',
        'موقع إلكتروني للنادي',
        'اجتماعات دورية'
      ];

      const toggleCheckbox = (category, value) => {
        setFormData(prev => ({
          ...prev,
          [category]: prev[category].includes(value)
            ? prev[category].filter(item => item !== value)
            : [...prev[category], value]
        }));
      };

      const handleSubmit = async () => {
        if (GITHUB_TOKEN === 'PASTE_YOUR_TOKEN_HERE') {
          alert('⚠️ لم يتم إعداد الاستبيان بعد. الرجاء إضافة GitHub Token في الكود.');
          return;
        }

        if (!formData.gender || !formData.age || !formData.studyLevel) {
          alert('الرجاء إكمال المعلومات الشخصية الأساسية');
          return;
        }

        setIsSubmitting(true);

        const formattedData = {
          timestamp: new Date().toISOString(),
          personalInfo: {
            gender: formData.gender,
            age: formData.age,
            studyLevel: formData.studyLevel
          },
          activities: formData.activities,
          culturalActivities: formData.culturalActivities,
          socialActivities: formData.socialActivities,
          sportsActivities: formData.sportsActivities,
          educationalActivities: formData.educationalActivities,
          preferences: {
            eventFrequency: formData.eventFrequency,
            preferredTime: formData.preferredTime,
            familyActivities: formData.familyActivities
          },
          expectations: formData.expectations,
          communicationMethod: formData.communicationMethod,
          volunteerInterest: formData.volunteerInterest,
          suggestions: formData.suggestions,
          contactInfo: formData.contactInfo
        };

        try {
          const response = await fetch(
            `https://api.github.com/repos/${REPO_OWNER}/${REPO_NAME}/dispatches`,
            {
              method: 'POST',
              headers: {
                'Authorization': `Bearer ${GITHUB_TOKEN}`,
                'Accept': 'application/vnd.github+json',
                'Content-Type': 'application/json',
              },
              body: JSON.stringify({
                event_type: 'survey-submission',
                client_payload: formattedData
              })
            }
          );

          if (response.status === 204) {
            alert('شكراً لمشاركتك! تم إرسال إجاباتك بنجاح ✅');
            
            setFormData({
              gender: '',
              age: '',
              studyLevel: '',
              activities: [],
              culturalActivities: [],
              socialActivities: [],
              sportsActivities: [],
              educationalActivities: [],
              eventFrequency: '',
              preferredTime: [],
              familyActivities: '',
              expectations: [],
              communicationMethod: [],
              volunteerInterest: '',
              suggestions: '',
              contactInfo: ''
            });
          } else {
            throw new Error('فشل الإرسال');
          }
        } catch (error) {
          console.error('Error:', error);
          
          const dataStr = JSON.stringify(formattedData, null, 2);
          const dataBlob = new Blob([dataStr], { type: 'application/json' });
          const url = URL.createObjectURL(dataBlob);
          const link = document.createElement('a');
          link.href = url;
          link.download = `survey-response-${Date.now()}.json`;
          link.click();
          
          alert('حدث خطأ في الإرسال. تم حفظ إجاباتك كملف. الرجاء إرساله إلى منظمي النادي.');
        } finally {
          setIsSubmitting(false);
        }
      };

      const CheckboxItem = ({ checked, onClick, label }) => (
        <div 
          onClick={onClick}
          className="flex items-start gap-2 p-3 rounded-lg hover:bg-green-50 cursor-pointer transition-colors"
        >
          {checked ? (
            <svg className="w-5 h-5 text-green-600 flex-shrink-0 mt-0.5" fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <rect x="3" y="3" width="18" height="18" rx="2" ry="2" strokeWidth="2"/>
              <polyline points="9 11 12 14 16 10" strokeWidth="2"/>
            </svg>
          ) : (
            <svg className="w-5 h-5 text-gray-400 flex-shrink-0 mt-0.5" fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <rect x="3" y="3" width="18" height="18" rx="2" ry="2" strokeWidth="2"/>
            </svg>
          )}
          <span className="text-gray-700">{label}</span>
        </div>
      );

      return (
        <div className="min-h-screen bg-gradient-to-br from-green-50 to-emerald-50 p-4 md:p-8">
          <div className="max-w-4xl mx-auto bg-white rounded-2xl shadow-xl overflow-hidden">
            <div className="bg-gradient-to-r from-green-600 to-emerald-600 p-8 text-white">
              <h1 className="text-3xl md:text-4xl font-bold mb-3">
                استبيان النادي السعودي - كولشيستر
              </h1>
              <p className="text-green-50 text-lg">
                نود معرفة آرائكم وتوقعاتكم لتطوير أنشطة النادي
              </p>
            </div>

            {GITHUB_TOKEN === 'PASTE_YOUR_TOKEN_HERE' && (
              <div className="m-8 p-4 bg-red-50 border-2 border-red-300 rounded-lg flex gap-3">
                <svg className="w-6 h-6 text-red-600 flex-shrink-0 mt-0.5" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M12 9v2m0 4h.01m-6.938 4h13.856c1.54 0 2.502-1.667 1.732-3L13.732 4c-.77-1.333-2.694-1.333-3.464 0L3.34 16c-.77 1.333.192 3 1.732 3z"/>
                </svg>
                <div className="text-sm text-red-800">
                  <strong>تنبيه:</strong> لم يتم إعداد GitHub Token بعد. الرجاء فتح الملف بمحرر نصوص واستبدال 'PASTE_YOUR_TOKEN_HERE' بالـ token الخاص بك.
                </div>
              </div>
            )}

            <div className="p-8 space-y-8">
              <div className="space-y-6">
                <h2 className="text-2xl font-bold text-gray-800 border-b-2 border-green-500 pb-2">
                  المعلومات الشخصية
                </h2>
                
                <div>
                  <label className="block text-gray-700 font-semibold mb-2">الجنس</label>
                  <div className="flex gap-4">
                    {['ذكر', 'أنثى'].map(option => (
                      <label key={option} className="flex items-center gap-2 cursor-pointer">
                        <input
                          type="radio"
                          name="gender"
                          value={option}
                          checked={formData.gender === option}
                          onChange={(e) => setFormData({...formData, gender: e.target.value})}
                          className="w-4 h-4 text-green-600"
                        />
                        <span className="text-gray-700">{option}</span>
                      </label>
                    ))}
                  </div>
                </div>

                <div>
                  <label className="block text-gray-700 font-semibold mb-2">الفئة العمرية</label>
                  <select
                    value={formData.age}
                    onChange={(e) => setFormData({...formData, age: e.target.value})}
                    className="w-full p-3 border-2 border-gray-300 rounded-lg focus:border-green-500 focus:outline-none"
                  >
                    <option value="">اختر الفئة العمرية</option>
                    <option value="18-24">18-24</option>
                    <option value="25-30">25-30</option>
                    <option value="31-35">31-35</option>
                    <option value="36+">36 فأكثر</option>
                  </select>
                </div>

                <div>
                  <label className="block text-gray-700 font-semibold mb-2">المرحلة الدراسية</label>
                  <select
                    value={formData.studyLevel}
                    onChange={(e) => setFormData({...formData, studyLevel: e.target.value})}
                    className="w-full p-3 border-2 border-gray-300 rounded-lg focus:border-green-500 focus:outline-none"
                  >
                    <option value="">اختر المرحلة الدراسية</option>
                    <option value="foundation">السنة التحضيرية</option>
                    <option value="bachelor">بكالوريوس</option>
                    <option value="master">ماجستير</option>
                    <option value="phd">دكتوراه</option>
                    <option value="language">دورة لغة</option>
                  </select>
                </div>
              </div>

              <div className="space-y-6">
                <h2 className="text-2xl font-bold text-gray-800 border-b-2 border-green-500 pb-2">
                  الأنشطة المفضلة
                </h2>

                <div>
                  <label className="block text-gray-700 font-semibold mb-3">
                    ما نوع الأنشطة التي تهمك؟ (يمكن اختيار أكثر من إجابة)
                  </label>
                  <div className="space-y-2">
                    {activities.map(activity => (
                      <CheckboxItem
                        key={activity}
                        checked={formData.activities.includes(activity)}
                        onClick={() => toggleCheckbox('activities', activity)}
                        label={activity}
                      />
                    ))}
                  </div>
                </div>

                {formData.activities.includes('أنشطة ثقافية') && (
                  <div className="bg-green-50 p-4 rounded-lg">
                    <label className="block text-gray-700 font-semibold mb-3">
                      الأنشطة الثقافية المفضلة:
                    </label>
                    <div className="space-y-2">
                      {culturalOptions.map(option => (
                        <CheckboxItem
                          key={option}
                          checked={formData.culturalActivities.includes(option)}
                          onClick={() => toggleCheckbox('culturalActivities', option)}
                          label={option}
                        />
                      ))}
                    </div>
                  </div>
                )}

                {formData.activities.includes('أنشطة اجتماعية') && (
                  <div className="bg-green-50 p-4 rounded-lg">
                    <label className="block text-gray-700 font-semibold mb-3">
                      الأنشطة الاجتماعية المفضلة:
                    </label>
                    <div className="space-y-2">
                      {socialOptions.map(option => (
                        <CheckboxItem
                          key={option}
                          checked={formData.socialActivities.includes(option)}
                          onClick={() => toggleCheckbox('socialActivities', option)}
                          label={option}
                        />
                      ))}
                    </div>
                  </div>
                )}

                {formData.activities.includes('أنشطة رياضية') && (
                  <div className="bg-green-50 p-4 rounded-lg">
                    <label className="block text-gray-700 font-semibold mb-3">
                      الأنشطة الرياضية المفضلة:
                    </label>
                    <div className="space-y-2">
                      {sportsOptions.map(option => (
                        <CheckboxItem
                          key={option}
                          checked={formData.sportsActivities.includes(option)}
                          onClick={() => toggleCheckbox('sportsActivities', option)}
                          label={option}
                        />
                      ))}
                    </div>
                  </div>
                )}

                {formData.activities.includes('محاضرات وورش عمل') && (
                  <div className="bg-green-50 p-4 rounded-lg">
                    <label className="block text-gray-700 font-semibold mb-3">
                      المواضيع التعليمية المفضلة:
                    </label>
                    <div className="space-y-2">
                      {educationalOptions.map(option => (
                        <CheckboxItem
                          key={option}
                          checked={formData.educationalActivities.includes(option)}
                          onClick={() => toggleCheckbox('educationalActivities', option)}
                          label={option}
                        />
                      ))}
                    </div>
                  </div>
                )}
              </div>

              <div className="space-y-6">
                <h2 className="text-2xl font-bold text-gray-800 border-b-2 border-green-500 pb-2">
                  التفضيلات والمشاركة
                </h2>

                <div>
                  <label className="block text-gray-700 font-semibold mb-2">
                    كم مرة تفضل إقامة الفعاليات؟
                  </label>
                  <select
                    value={formData.eventFrequency}
                    onChange={(e) => setFormData({...formData, eventFrequency: e.target.value})}
                    className="w-full p-3 border-2 border-gray-300 rounded-lg focus:border-green-500 focus:outline-none"
                  >
                    <option value="">اختر التكرار</option>
                    <option value="weekly">أسبوعياً</option>
                    <option value="biweekly">كل أسبوعين</option>
                    <option value="monthly">شهرياً</option>
                    <option value="quarterly">كل ثلاثة أشهر</option>
                  </select>
                </div>

                <div>
                  <label className="block text-gray-700 font-semibold mb-3">
                    الأوقات المفضلة لإقامة الفعاليات:
                  </label>
                  <div className="space-y-2">
                    {['نهاية الأسبوع (السبت والأحد)', 'أيام الأسبوع مساءً', 'أيام الأسبوع نهاراً'].map(time => (
                      <CheckboxItem
                        key={time}
                        checked={formData.preferredTime.includes(time)}
                        onClick={() => toggleCheckbox('preferredTime', time)}
                        label={time}
                      />
                    ))}
                  </div>
                </div>

                <div>
                  <label className="block text-gray-700 font-semibold mb-2">
                    هل معك عائلة في كولشيستر؟
                  </label>
                  <div className="flex gap-4">
                    {['نعم', 'لا'].map(option => (
                      <label key={option} className="flex items-center gap-2 cursor-pointer">
                        <input
                          type="radio"
                          name="familyActivities"
                          value={option}
                          checked={formData.familyActivities === option}
                          onChange={(e) => setFormData({...formData, familyActivities: e.target.value})}
                          className="w-4 h-4 text-green-600"
                        />
                        <span className="text-gray-700">{option}</span>
                      </label>
                    ))}
                  </div>
                </div>
              </div>

              <div className="space-y-6">
                <h2 className="text-2xl font-bold text-gray-800 border-b-2 border-green-500 pb-2">
                  التوقعات من النادي السعودي
                </h2>

                <div>
                  <label className="block text-gray-700 font-semibold mb-3">
                    ما هي توقعاتك من النادي السعودي؟ (يمكن اختيار أكثر من إجابة)
                  </label>
                  <div className="space-y-2">
                    {expectations.map(expectation => (
                      <CheckboxItem
                        key={expectation}
                        checked={formData.expectations.includes(expectation)}
                        onClick={() => toggleCheckbox('expectations', expectation)}
                        label={expectation}
                      />
                    ))}
                  </div>
                </div>

                <div>
                  <label className="block text-gray-700 font-semibold mb-3">
                    طرق التواصل المفضلة:
                  </label>
                  <div className="space-y-2">
                    {communicationMethods.map(method => (
                      <CheckboxItem
                        key={method}
                        checked={formData.communicationMethod.includes(method)}
                        onClick={() => toggleCheckbox('communicationMethod', method)}
                        label={method}
                      />
                    ))}
                  </div>
                </div>

                <div>
                  <label className="block text-gray-700 font-semibold mb-2">
                    هل أنت مهتم بالتطوع في تنظيم الفعاليات؟
                  </label>
                  <div className="space-y-2">
                    {['نعم، أود المشاركة', 'ربما في المستقبل', 'لا، أفضل الحضور فقط'].map(option => (
                      <label key={option} className="flex items-center gap-2 cursor-pointer">
                        <input
                          type="radio"
                          name="volunteerInterest"
                          value={option}
                          checked={formData.volunteerInterest === option}
                          onChange={(e) => setFormData({...formData, volunteerInterest: e.target.value})}
                          className="w-4 h-4 text-green-600"
                        />
                        <span className="text-gray-700">{option}</span>
                      </label>
                    ))}
                  </div>
                </div>
              </div>

              <div className="space-y-6">
                <h2 className="text-2xl font-bold text-gray-800 border-b-2 border-green-500 pb-2">
                  الاقتراحات والملاحظات
                </h2>

                <div>
                  <label className="block text-gray-700 font-semibold mb-2">
                    هل لديك أي اقتراحات أو أفكار لتطوير النادي؟
                  </label>
                  <textarea
                    value={formData.suggestions}
                    onChange={(e) => setFormData({...formData, suggestions: e.target.value})}
                    rows="4"
                    className="w-full p-3 border-2 border-gray-300 rounded-lg focus:border-green-500 focus:outline-none"
                    placeholder="شاركنا أفكارك واقتراحاتك..."
                  />
                </div>

                <div>
                  <label className="block text-gray-700 font-semibold mb-2">
                    معلومات التواصل (اختياري)
                  </label>
                  <input
                    type="text"
                    value={formData.contactInfo}
                    onChange={(e) => setFormData({...formData, contactInfo: e.target.value})}
                    className="w-full p-3 border-2 border-gray-300 rounded-lg focus:border-green-500 focus:outline-none"
                    placeholder="البريد الإلكتروني أو رقم الواتساب"
                  />
                </div>
              </div>

              <div className="pt-4">
                <button
                  onClick={handleSubmit}
                  disabled={isSubmitting}
                  className="w-full bg-gradient-to-r from-green-600 to-emerald-600 text-white font-bold py-4 px-6 rounded-lg hover:from-green-700 hover:to-emerald-700 transition-all duration-300 shadow-lg text-lg flex items-center justify-center gap-2 disabled:opacity-50 disabled:cursor-not-allowed"
                >
                  <svg className="w-5 h-5" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M12 19l9 2-9-18-9 18 9-2zm0 0v-8"/>
                  </svg>
                  {isSubmitting ? 'جاري الإرسال...' : 'إرسال الاستبيان'}
                </button>
              </div>

              <p className="text-center text-gray-500 text-sm">
                شكراً لوقتك ومشاركتك معنا 🇸🇦
              </p>
            </div>
          </div>
        </div>
      );
    }

    ReactDOM.render(<SaudiStudentSurvey />, document.getElementById('root'));
  </script>
</body>
</html>
